import React, { Component } from "react";
import DishDetail from "./components/DishdetailComponent";

class Menu extends Component {
  constructor(props) {
    super(props);

    this.state = {page: <DishDetail />}
  }
  loadPage = (page) => {
    this.setState({page: page})
  }

  render() {
    return (
      <div>
        <DishDetail />
      </div>
    );
  }
}

export default Menu;
